import palette from '../../lib/styles/palette';

const AlerterHolder = styled.div`
  width: 100%;
  margin-top: 3rem;
  padding: 2rem auto;
  text-align: center;
  height: 10rem;
  background: ${palette.gray[2]};
  border-radius: 5px;
`;

const NoPrizedAlerter = () => {
  return (
    <AlerterHolder>
      <p>asdfads</p>
    </AlerterHolder>
  );
};

export default NoPrizedAlerter;
